import React from 'react'
import UploadFile from './components/UploadFile'
import DownloadFile from './components/DownloadFile'

const App = () => {
  return (
    <div className='m-auto'>
      <div className='text-xl'> S3 - Upload and Download files</div>
      <UploadFile />
      <DownloadFile />
    </div>
  )
}

export default App
